import React from "react";
import { useAuth } from "../user/AuthUserContext";

const HomeLogged = () => {

    const { userData } = useAuth();
    console.log(userData)


  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col cardhome">
          <h1>Bienvenido {userData.st_NombreUser}</h1>




          <div className="cardhome">
            <div className="col">

                <link to="/newpost">
                <button className="btn btnhomelog">Nueva entrada</button>
                </link>
                <button className="btn btnhomelog">Mis entradas</button>




            </div>


          </div>
        </div>
      </div>
    </div>
  );
};

export default HomeLogged;
